import styled from "styled-components";

export const PlanWrapper=styled.div`
  .todo-item::after{
    border-top:1px solid #ccc;
    content:'';
    display:table;
    clear:both;

  }
  .todo-item:last-child{
    border-bottom:1px solid #ccc;
  }
  .todo-item input{
    float:left;
    margin-right:10px
  }
  .todo-item div{
    float:left;
    margin-right:80px;
  }`
